import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

import {BrowserRouter} from 'react-router-dom';

ReactDOM.render(
  <BrowserRouter>'
  <h1>Neekeri</h1>
    <App />
  </BrowserRouter>,
  document.getElementById('index')
);
